import LeftToRightComponents from "../../../utils/components/LeftToRightComponents";

const StageTemplate = ({ nomEntreprise, dates, duree, logo, children }) => {
	return (
		<div className='stage-card'>
			<span className='nom-entreprise'>{nomEntreprise}</span>
			<span className='dates'>{dates}</span>
			<br />
			{logo}
			<br />
			{children}
			<div className='duree'>{duree}</div>
		</div>
	);
};

const StageBanijay = () => {
	return (
		<StageTemplate nomEntreprise='Banijay' dates='9 janvier 2018 - 7 juin 2018' duree='4 mois' logo='HAHA'>
			HAHA MDR IOFGZHGMUOIGZAMOGHZAOGIHJZAIOPJZ aipzhogozamhgozaihgizoah zapojfopzahoigfpazj 
		</StageTemplate>
	);
};

const StageLagardere = () => {
	return <>Lagardere</>;
};

function Experience() {
	return (
		<LeftToRightComponents height='50vh' flex={1} durationInMs={350}>
			<StageBanijay />
			<StageLagardere />
		</LeftToRightComponents>
	);
}

export default Experience;
